const SearchBox = () => {

    return (

        <div>

            <input 
            type="search"
            placeholder="Search Robot"
            className="f6 grow no-underline br-pill ba bw2 ph3 pv2 mb2 dib near-green"
            
            />

        </div>

    );

}

export default SearchBox;
